import {Menu, Input } from 'antd';

/*
左侧导航的组件
 */
export default class LeftNav extends Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <Menu.Item key='new-menu'>
                <Input></Input>
            </Menu.Item>
        )
    }
}
